import Clock from 'react-live-clock';

export default function Liveclock() {
    return (
        <div id="render-item" className='bg-white py-3 px-7 rounded-md font-mont font-neon absolute top-[600px] w-[200px] h-[100px] left-[1160px]'>
            <Clock format={'HH:mm:ss'} ticking={true} timezone={'VN'} date={''} />
            
            <div><Clock format={'ddd, MMM D YYYY'} ticking={true} timezone={'VN'} date={''} /></div>
        </div>


    )
}
